import React, { useState, useEffect } from 'react';
import './trendbar.css';
import TrendOption from '../trend-option/trend-option';
import mock_data from '../../mock/mock.json';

const trendingTopics = [
  { name: "Homework" },
  { name: "Projects" },
  { name: "Attendance" },
]

function Trendbar() {
  const [data, setData] = useState(null);

  // useEffect(() => {
